import React from 'react';
import {IonButtons, IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonBackButton, IonMenuButton} from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './AddTrip.css';

const AddTrip: React.FC = () => {
  return (
      <IonPage>
        <IonHeader>
          <IonToolbar>
            <IonButtons slot="start">
              <IonBackButton />
            </IonButtons>
            <IonTitle>Add Trip</IonTitle>
          </IonToolbar>
        </IonHeader>
        <IonContent>
          <IonHeader collapse="condense">
            <IonToolbar>
              <IonTitle size="large">Add Trip</IonTitle>
            </IonToolbar>
          </IonHeader>
          <ExploreContainer name="Add Trip page" />
        </IonContent>
      </IonPage>
  );
};

export default AddTrip;
